import React from 'react';
import ReactDOM from 'react-dom/client';
import Dashboard from './pagesDashboard.jsx'; // 1. Importa seu dashboard

// 2. Cria a raiz do React no elemento 'root'
const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);

// 3. Renderiza seu Dashboard, tornando-o o conteúdo principal!
root.render(
  <React.StrictMode>
    <Dashboard /> 
  </React.StrictMode>
);
